def Bubble_Sort(arr):
    n = len(arr)
    flag = True

    for i in range(1, n):
        flag = False

        for j in range(n - i):
            if arr[j] > arr[j + 1]:
                arr[j], arr[j + 1] = arr[j + 1], arr[j]
                flag = True

        if not flag:
            break

    return arr

