def findZeroes(arr, n, m):
    wL = wR = bestL = bestWindow = 0
    zeroCount = 0
    while wR < n:
        if zeroCount <= m:
            if arr[wR] == 0:
                zeroCount += 1
            wR += 1
        if zeroCount > m:
            if arr[wL] == 0:
                zeroCount -= 1
            wL += 1
        if (wR - wL) > bestWindow and (zeroCount <= m):
            bestWindow = wR - wL
            bestL = wL
    for i in range(bestWindow):
        arr[bestL + i] = 0
    return list(range(bestL, bestL+bestWindow))
