def countOnes(arr, low, high):
    if high >= low:
        mid = low + (high - low) // 2
        if (mid == high or arr[mid + 1] == 0) and arr[mid] == 1:
            return mid + 1
        elif arr[mid] == 1:
            return countOnes(arr, mid + 1, high)
        else:
            return countOnes(arr, low, mid - 1)
    return 0

