def findTwoGroup(n):
    total_sum = n * (n + 1) // 2
    group1Sum = total_sum // 2
    group1 = []
    group2 = []
    for i in range(n, 0, -1):
        if group1Sum - i >= 0:
            group1.append(i)
            group1Sum -= i
        else:
            group2.append(i)

