def largestSumOfAverages(A, K):
    n = len(A)
    pre_sum = [0] * (n + 1)
    pre_sum[0] = 0
    for i in range(n):
        pre_sum[i+1] = pre_sum[i] + A[i]

    dp = [0] * n

    for k in range(K - 1):
        for i in range(n):
            max_avg = 0
            for j in range(i+1, n):
                curr_avg = (pre_sum[j]- pre_sum[i]) / (j-i) + dp[j]
                if curr_avg > max_avg:
                    max_avg = curr_avg
            dp[i] = max_avg 
