def subCount(arr, n, k):
    mod = [0] * k
    cumSum = 0
    for i in range(0, n):
        cumSum += arr[i]
        mod[(cumSum % k + k) % k] += 1
    result = 0
    for i in range(0, k):
        if mod[i] > 1:
            result += int((mod[i] * (mod[i] - 1)) / 2)
    result += mod[0]
    return result

def countSubmatrix(mat, n, k):
    tot_count = 0
    temp = [0] * n
    for left in range(0, n-1):
        for right in range(left, n):
            for i in range(0, n):
                temp[i] += mat[i][right]
            tot_count += subCount(temp, n, k)
    return tot_count

