def getLeftmostBit(n):
    m = 0
    while n > 1:
        n = n >> 1
        m += 1
    return m

def getNextLeftmostBit(n, m):
    temp = 1 << m
    while n < temp:
        temp = temp >> 1
        m -= 1
    return m

def countSetBits(n):
    m = getLeftmostBit(n)
    return _countSetBits(n, m)

def _countSetBits(n, m):
    if n == 0:
        return 0
    m = getNextLeftmostBit(n, m)
    if n == (1 << (m + 1)) - 1:
        return (m + 1) * (1 << m)
    n = n - (1 << m)
    return n + countSetBits(n) + m * (1 << (m - 1))

