def pi(x, v):
    l, r = 0, len(v) - 1
    m, i = -1, -1
    while (l <= r):
        m = (l + r) // 2
        if (v[m] <= x):
            i = m
            l = m + 1
        else:
            r = m - 1
    return i + 1
