def count_triplets(target, arr):
    length = len(arr)
    totalCount = 0

    for i in range(length - 2):
        if target % arr[i] == 0:
            for j in range(i + 1, length - 1):
                if target % (arr[i] * arr[j]) == 0:
                    toFind = target // (arr[i] * arr[j])
                    for k in range(j + 1, length):
                        if arr[k] == toFind:
                            totalCount += 1

    return totalCount

