import math

def copyToFinal(curr_path):
    final_path[:N+1] = curr_path[:]
    final_path[N] = curr_path[0]

def firstMin(adj, i):
    min_val = float('inf')
    for k in range(len(adj)):
        if adj[i][k] < min_val and i != k:
            min_val = adj[i][k]
    return min_val

def secondMin(adj, i):
    first, second = float('inf'), float('inf')
    for j in range(len(adj)):
        if i == j:
            continue
        if adj[i][j] <= first:
            second = first
            first = adj[i][j]
        elif adj[i][j] < second and adj[i][j] != first:
            second = adj[i][j]
    return second

def TSPRec(adj, curr_bound, curr_weight, level, curr_path, visited):
    global final_res
    if level == len(adj):
        if adj[curr_path[level-1]][curr_path[0]] != 0:
            curr_res = curr_weight + adj[curr_path[level-1]][curr_path[0]]
            if curr_res < final_res:
                copyToFinal(curr_path)
                final_res = curr_res
        return
    for i in range(len(adj)):
        if adj[curr_path[level-1]][i] != 0 and not visited[i]:
            temp = curr_bound
            curr_weight += adj[curr_path[level-1]][i]
            if level ==  1:
                curr_bound -= (firstMin(adj, curr_path[level-1]) + firstMin(adj, i)) / 2
            else:
                curr_bound -= (secondMin(adj, curr_path[level-1]) + firstMin(adj, i)) / 2
            if curr_bound + curr_weight < final_res:
                curr_path[level] = i
                visited[i] = True
                TSPRec(adj, curr_bound, curr_weight, level+1, curr_path, visited)
            curr_weight -= adj[curr_path[level-1]][i]
            curr_bound = temp
            visited = [False]*len(visited)
            for j in range(level):
                if curr_path[j] != -1:
                    visited[curr_path[j]] = True

def TSP(adj):
    global N, final_res, final_path
    N = len(adj)
    final_res = float('inf')
    final_path = [-1] * (N + 1)  # Initialize final_path
    curr_bound = 0
    curr_weight = 0
    visited = [False]*N
    for i in range(len(adj)):
        curr_bound += (firstMin(adj,i) + secondMin(adj,i))
    curr_bound = math.ceil(curr_bound / 2)
    visited[0] = True
    TSPRec(adj, curr_bound, curr_weight, 1, final_path, visited)

