def dfs(n, m, stepNum):
    if not (stepNum >= n and stepNum <= m):  # Check if within range
        return ""

    lastDigit = stepNum % 10
    res = str(stepNum) + "  "

    if lastDigit == 0:
        res += dfs(n, m, stepNum * 10 + 1)
    elif lastDigit == 9:
        res += dfs(n, m, stepNum * 10 + 8)
    else:
        res += dfs(n, m, stepNum * 10 + (lastDigit - 1))
        res += dfs(n, m, stepNum * 10 + (lastDigit + 1))

    return res

