def totalSubSets ( n , l , r ) :
    MOD = 1000000007 ;
    zero = ( math . floor ( r / 3 ) - math . ceil ( l / 3 ) + 1 ) ;
    one = ( math . floor ( ( r - 1 ) / 3 ) - math . ceil ( ( l - 1 ) / 3 ) + 1 ) ;
    two = ( math . floor ( ( r - 2 ) / 3 ) - math . ceil ( ( l - 2 ) / 3 ) + 1 ) ;
