def findMinSum(arr, n):
    if n < 0:
        raise ValueError("Negative length")
    elif n == 0:
        return 0
    elif n == 1:
        return arr[0]
    else:
        min1 = findMinSum(arr, n-1)
        min2 = findMinSum(arr[1:], n-1)
        return min(min1, min2)

