import math
def max_gcd ( n , p ) :
    count = 0 ;
    gcd = 1 ;
    while ( p % 2 == 0 ) :
        p >>= 1 ;
        count = count + 1 ;
    if ( count > 0 ) :
        gcd = gcd * pow ( 2 , count // n ) ;
    for i in range ( 3 , ( int ) ( math . sqrt ( p ) ) , 2 ) :
        count = 0 ;
        while ( p % i == 0 ) :
            count = count + 1 ;
            p = p // i ;
        if ( count > 0 ) :
            gcd = gcd * pow ( i , count // n ) ;
    if ( p > 2 ) :
        gcd = gcd * pow ( p , 1 // n ) ;
    return gcd ;
