import sys
def CalculateDifference ( arr , n ) :
    max_val = - 1
    for i in range ( 0 , n ) :
        if ( arr [ i ] > max_val ) :
            max_val = arr [ i ]
    prime = [ True for i in range ( max_val + 1 ) ]
    prime [ 0 ] = False
    prime [ 1 ] = False
    p = 2
    while ( p * p <= max_val ) :
        if prime [ p ] == True :
            for i in range ( p * 2 , max_val + 1 , p ) :
                prime [ i ] = False
        p += 1
    S1 = 0
    S2 = 0
    for i in range ( 0 , n ) :
        if prime [ arr [ i ] ] :
            S1 += arr [ i ]
        elif arr [ i ] != 1 :
            S2 += arr [ i ]
    return abs ( S2 - S1 )
