def MinOfCubedDP ( k ) :
    DP = [ 0 ] * ( k + 1 ) ;
    j = 1 ;
    t = 1 ;
    DP [ 0 ] = 0 ;
    for i in range ( 1 , k + 1 ) :
        DP [ i ] = sys . maxsize ;
