def bestpermutation(arr, k, n):
    h = {}
    for i in range(n):
        h[arr[i]] = i

    if (n <= k):
        arr.sort()
        arr.reverse()
    else:
        for j in range(n, 0, -1):
            if (k > 0):
                initial_index = h[j]
                best_index = n - j

                if (initial_index != best_index):
                    h[j] = best_index
                    element = arr[best_index]
                    h[element] = initial_index

