from collections import deque

adj = [ [] for i in range (100) ]

def addEdge(u, v):
    adj[u].append(v)

def getindeg(V, indeg):
    for i in range(V):
        for x in adj[i]:
            indeg[x] += 1

def topo(V, indeg):
    q = deque()
    for i in range(V):
        if (indeg[i] == 0):
            q.appendleft(i)

    res = []
    while len(q) > 0:
        u = q.popleft()
        res.append(u)

        for x in adj[u]:
            indeg[x] -= 1

            if (indeg[x] == 0):
                q.appendleft(x)

    return res

def makearray(v, V):
    for i in range(len(v)):
        for j in range(len(v[i]) - 1):
            addEdge(v[i][j], v[i][j + 1])

    indeg = [0 for i in range(V)]

    getindeg(V, indeg)

    res = topo(V, indeg)

    return res

