def find_max_prime(numbers):
    # Logic to find the maximum prime number in the list
    max_prime = None

    for num in numbers:
        is_prime = True

        if num < 2:
            continue

        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                is_prime = False
                break

        if is_prime and (max_prime is None or num > max_prime):
            max_prime = num

    return max_prime

