def find_max_length_whitespace(string):
    if not string:
        return 0

    max_length = 0
    current_length = 0

    for char in string:
        if char.isspace():
            current_length += 1
            max_length = max(max_length, current_length)
        else:
            current_length = 0

    return max_length

