def setBitCount(num):
    count = 0
    while num:
        if num & 1:
            count += 1
        num >>= 1
    return count


def sortBySetBitCount(arr, n):
    count = []
    for i in range(n):
        count.append([-1 * setBitCount(arr[i]), arr[i]])

    count.sort(key=lambda x: x[0])

    result = ""
    for i in range(len(count)):
        result += str(count[i][1]) + "  "

    return result

