def maxXORUtil(arr , N , xrr , orr):
    if (N == 0):
        return xrr ^ orr
    x = maxXORUtil(arr , N - 1 , xrr ^ orr , arr[N - 1])
    y = maxXORUtil(arr , N - 1 , xrr , orr)
