    prime = [0] * (n + 1)
    total_sum = 0
    max_val = int(n / 2)

    for p in range(2, max_val + 1):
        if prime[p] == 0:
            for i in range(p*2, n+1, p):
                prime[i] = p

    for p in range(2, n+1):
        if prime[p]:
            total_sum += prime[p]
        else:
