def getDigitProduct(x):
    if x < 10:
        return x
    if prodDig[x]:
        return prodDig[x]
    prod = int(x % 10) * getDigitProduct(int(x / 10))
    prodDig[x] = prod
    return prod

def findSeed(n):
    res = []
    for i in range(1, int(n/2 + 2)):
        if i * getDigitProduct(i) == n:
            res.append(i)
    if not res:
        return "No seed exists"
    else:
        return ', '.join([str(r) for r in res])

