def merge_dicts(*args):
    """
    Merge multiple dictionaries into a single dictionary.

    Args:
        *args: Variable number of dictionaries to be merged.

    Returns:
        dict: Merged dictionary.

    """
    merged_dict = {}
    for dictionary in args:
        merged_dict.update(dictionary)
    return merged_dict

