def sum_of_elements(*args):
    """
    Calculate the sum of all elements in multiple sets.

    Args:
        *args: Variable number of sets.

    Returns:
        The sum of all elements in the sets.
    """
    total_sum = 0

    # Iterate over each set
    for s in args:
        # Iterate over each element in the set
        for elem in s:
            total_sum += elem

    return total_sum


